let CryptoJS = require('crypto-js');

function xxx(e) {
    const t = 'uVayqL4ONKjFbVzQ';
    var r = CryptoJS.enc.Utf8.parse(t)
        , n = CryptoJS.AES.decrypt(e, r, {
        mode: CryptoJS.mode.ECB,
        padding: CryptoJS.pad.Pkcs7,
    });
    return JSON.parse(CryptoJS.enc.Utf8.stringify(n));

}

